import React from "react";

import { Table } from "react-bootstrap";

const InputTable = () => {
    return (
        <>
            <Table striped bordered hover>
                <thead>
                <tr>
                    <th>#</th>
                    <th>First Name</th>
                    <th>Last Name</th>
                    <th>Username</th>
                </tr>
                </thead>
            </Table>
        </>
    );
};

export default InputTable;
